import React, {Component} from "react";

class Control extends Component {
    render(){
        return(
            <div>
                <form>
                    <div class="row-info">
                        <input type="text" class="textfield" />
                        <input type="button" name="find" value="Find" />
                    </div>
                </form>
            </div>
        )
    }
}

export default Control;
